import { Outlet } from "react-router-dom";
import Navbar from "./components/Navbar";

function App() {
  return (
    <div className="App">
      <Navbar />
      <div className="content">
        <Outlet /> {/* This renders the current route */}
      </div>
    </div>
  );
}

export default App;
